import React from "react";
import { NavLink } from "react-router-dom";
import './NavTab.css'

function NavTab() {
    const isloggedIn = false;

  return (
    <nav className="nav-tab nav-tab__container">
        {!isloggedIn ? (
        <><NavLink to="/signup" className="nav-tab__link">Регистрация</NavLink><NavLink to="/signin" className="nav-tab__link nav-tab__link_type_signin">Войти</NavLink></>
        ) : (
            <><NavLink to="/signup" className="nav-tab__link">fggbfgbfgbfgb</NavLink><NavLink to="/signin" className="nav-tab__link nav-tab__link_type_signin">Войти</NavLink></>  
        )}
    </nav>
  );
}

export default NavTab;
